import React from 'react';
import '../css/Page2.css';


function Page2() {
  return (
    <div className="page2">
      <p>“The fearful thing about the Chinese literary scene is that everyone keeps introducing new terms without defining them. And everyone interprets these terms as he pleases. To write a good deal about yourself is expressionism. To write largely about others is realism. To write poems on a girl's leg is romanticism. To ban poems on a girl's leg is classicism.”</p>
    </div>
    
  );
}

export default Page2;
